Information
------------------------------

Top Ten Natural Disasters
Ten world experts formulate a list of the most important natural disasters of all time. 
Using eye witness video, historical archive and cutting edge CGI, they not only reveal the key moments that turned a natural phenomenon into a human catastrophe, but explain why the disaster they've selected is a genuine game-changer, worthy of its place as a one of the 'Top Ten Natural Disasters'.

